import React from 'react';
import './App.css';
import Login from './paginas/Login';
import Logout from './paginas/Logout';
import Dashboard from './paginas/Dashboard';
import Home from './paginas/Home';
import Header from "./componentes/Header";
import { BrowserRouter, Switch, Route, NavLink } from 'react-router-dom';
import PrivateRoute from "./componentes/PrivateRoute1";
import PublicRoute from "./componentes/PublicRoute1";
import { getToken} from "./utils/Commons";
import PrivateLinkMenu from './componentes/PrivateLinkMenu';
import PublicLinkMenu from './componentes/PublicLinkMenu';


class App extends React.Component{
    state = {
        loggedIn: false
    };

    handleLoggedIn = loggedIn => {
        this.setState({loggedIn});
    }

    render () {
        return (
            <div>

                <Header className="App-header" />

                <BrowserRouter>
                    <div>
                        <div className="header">
                            <PublicLinkMenu activeClassName="active" urlto="/accion_social/login" texttourl="Login" />
                            <PrivateLinkMenu activeClassName="active" exact urlto="/accion_social" texttourl="Home" />
                            <PrivateLinkMenu activeClassName="active" exact urlto="/accion_social/logout" texttourl="Logout" />
                        </div>
                        <div className="content">
                            <Switch>
                            <PrivateRoute exact path="/accion_social">
                                    <Home />
                                </PrivateRoute>                                
                                <PublicRoute path="/accion_social/login">
                                    <Login onLoggedIn={this.handleLoggedIn }/>
                                </PublicRoute>
                                {/*<PrivateRoute exact path="/accion_social" component={Home} />

                                <PublicRoute path="/accion_social/login" component={Login} />
                                <PrivateRoute path="/accion_social/logout" component={Logout} />*/}
                            </Switch>
                        </div>
                    </div>
                </BrowserRouter>

            </div>
        );
    }
}

export default App;
